			shellPath = /bin/sh;
			shellScript = "#!/bin/bash\n\n# This script automates copying the correct `GoogleService-Info.plist` file based on the build environment (Mock, Staging, Release).\n# Define the path to the GoogleService-Info.plist files for different configurations\n\nMOCK_PLIST_PATH=\"${PROJECT_DIR}/MobileBackend/Config/Firebase/Mock/GoogleService-Info.plist\"\nSTAGING_PLIST_PATH=\"${PROJECT_DIR}/MobileBackend/Config/Firebase/Staging/GoogleService-Info.plist\"\nRELEASE_PLIST_PATH=\"${PROJECT_DIR}/MobileBackend/Config/Firebase/Release/GoogleService-Info.plist\"\n\n# Destination path for the GoogleService-Info.plist in the app's bundle\nDESTINATION_PLIST_PATH=\"${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app/GoogleService-Info.plist\"\n\necho \"Current Configuration: ${CONFIGURATION}\"\necho \"Mock plist path: ${MOCK_PLIST_PATH}\"\necho \"Staging plist path: ${STAGING_PLIST_PATH}\"\necho \"Release plist path: ${RELEASE_PLIST_PATH}\"\necho \"Destination path: ${DESTINATION_PLIST_PATH}\"\n\n# Function to copy the plist file with error checking\ncopy_plist() {\n    src=$1\n    dest=$2\n\n    if [ -f \"$src\" ]; then\n        echo \"Copying plist from $src to $dest\"\n        cp \"$src\" \"$dest\"\n        if [ $? -ne 0 ]; then\n            echo \"Error: Failed to copy plist file.\"\n            exit 1\n        fi\n    else\n        echo \"Error: Source plist file does not exist at $src\"\n        exit 1\n    fi\n}\n\n# Determine which plist to use based on the custom environment variable\ncase \"${ENVIRONMENT}\" in\n    \"Mock\")\n        copy_plist \"${MOCK_PLIST_PATH}\" \"${DESTINATION_PLIST_PATH}\"\n        ;;\n    \"Staging\")\n        copy_plist \"${STAGING_PLIST_PATH}\" \"${DESTINATION_PLIST_PATH}\"\n        ;;\n    \"Release\")\n        copy_plist \"${RELEASE_PLIST_PATH}\" \"${DESTINATION_PLIST_PATH}\"\n        ;;\n    *)\n        echo \"Environment not recognized, using Development GoogleService-Info.plist as default\"\n        copy_plist \"${STAGING_PLIST_PATH}\" \"${DESTINATION_PLIST_PATH}\"\n        ;;\nesac\n";
